import React, {Component} from "react";
import { Card, Form, Input, Button, Checkbox, DatePicker, Select, Radio } from 'antd';
const FormItem = Form.Item;
const Option = Select.Option;
const RadioGroup = Radio.Group;
import styles from './css/index.module.css'
import 'moment/locale/zh-cn';
import locale from 'antd/es/date-picker/locale/zh_CN';
const { RangePicker } = DatePicker;
class NewMeet extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }

    componentDidMount() {
    }

    render() {

        return (
            <Card title="会议预定" bordered={false}>

                <Form horizontal>
                    <FormItem
                        id="control-input"
                        label="输入框"
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 14 }}
                    >
                        <Input id="control-input" placeholder="Please enter..." />
                    </FormItem>

                    <FormItem
                        id="control-textarea"
                        label="文本域"
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 14 }}
                    >
                        <Input type="textarea" id="control-textarea" rows="3" />
                    </FormItem>

                

                    <FormItem
                        label="Checkbox 多选框"
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 18 }}
                    >
                        <Checkbox className="ant-checkbox-vertical">选项一</Checkbox>
                        <Checkbox className="ant-checkbox-vertical">选项二</Checkbox>
                        <Checkbox className="ant-checkbox-vertical" disabled>选项三（不可选）</Checkbox>
                    </FormItem>

                 
                </Form>

                <Form
                    name="basic"
                    initialValues={{remember: true}}
                    className={styles.form}
                >
                    <Form.Item
                        id="control-input"
                        label="输入框"
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 14 }}
                    >
                        <Input id="control-input" placeholder="Please enter..." />
                    </Form.Item>
                    <Form.Item
                        label="会议名称"
                        name="username"
                        rules={[{required: true, message: 'Please input your username!'}]}
                        className={styles.formItem}
                        labelCol={{ span: 6 }}
                        wrapperCol={{ span: 14 }}
                    >
                        <Input/>
                    </Form.Item>
                    <Form.Item
                        label="会议时间"
                        name="timeRange"
                        rules={[{required: true, message: 'Please input your username!'}]}
                        className={styles.formItem}
                    >
                        <RangePicker
                            showTime={{ format: 'HH:mm' }}
                            format="YYYY-MM-DD HH:mm"
                            locale={locale}
                        />
                    </Form.Item>
                    <Form.Item
                        label="会议密码（选填）"
                        name="code"
                        className={styles.formItem}
                     >
                        <Input placeholder='请输入4到6位数字密码'/>
                    </Form.Item>
                    <Form.Item  className={styles.formItem}>
                        <Button type="primary">预定会议</Button>
                    </Form.Item>
                </Form>
            </Card>
        )
    }
}

export default NewMeet
